scriptlet.script:
// This template shows how to access operation return data, inputs and context data 
// and how to set context data, responses and results. 

// To access an input simply refer to the input name from the Inputs panel.  For example: 
var dataStore = field1; 

// To get value associated with the context key myContextKey: 
var dataStoreList = scriptletContext.get("Datastores"); 
scriptletContext.put("Test123",dataStoreList); 
var newDatastores = "";

//############
//split datastores at |
var dataStoreArray = dataStoreList.split("#");
scriptletContext.put("Test1243",dataStoreArray.length); 
var count = 0;
//go through all datastores
for(i = 0; i<dataStoreArray.length; i++)
{

	tempds = dataStoreArray[i].split(":");
	//split datastore at :

	if(tempds[1] == dataStore)
	{
		//check if there is already a counter set
		if(tempds[4] == undefined)
		{
			//if not
			//simply add the counte
			count = 1;
		}
		else
		{
			//if yes
			//counter + 1
			count = parseInt(tempds[4],10)+1;
		}
		scriptletContext.put("Test12345",tempds[4]);
		dataStoreArray[i] = tempds[0]+":"+tempds[1]+":"+tempds[2]+":"+tempds[3]+":"+count;
	}



	if(newDatastores == "")
		newDatastores = dataStoreArray[i];
	else
		newDatastores = newDatastores + "#"+dataStoreArray[i];
}


//finally remaerge everything
scriptletResponse = "Success"; 

// To set the result of the operation 
//scriptletResult = "Your Result Here"; 

// Use the context to hold data for use by other steps.  It is also helpful to place information 
// into the context to examine variables when developing and debugging scriptlets. 
// For example to place the OutputString information into a context key called 'Output': 
//scriptletContext.putGlobal("Output", data); 

// Note that the Key and Value are both strings.  For example to place 'code' into the context: 
//scriptletContext.putGlobal("Code", code.toString()); 

// You can also place data into the local context, which means it will only be available to 
// the current flow, but not to its parent flow or other subflows.  To do this: 
scriptletContext.put("finalDatastores",newDatastores); 

// ===========================================================================================
